import Banner from "./components/Banner";
import { useEffect, useState } from "react";
import MainScreen from "./screens/MainScreen";
import { SESSION } from "./constants/AppConstants";

const App = () => {
  const [token, setToken] = useState(SESSION.LOGGED_OUT);

  useEffect(() => {
    console.log("TOKEN: " + token);
  }, [token]);
  return (
    <div className="App">
      <Banner />
      <MainScreen token={token} setToken={setToken} />
    </div>
  );
};

export default App;
